import React, { useState, useEffect } from "react";

function Survey() {
  const [questionBank, setQuestionBank] = useState({questions: []});
  const [responseBank, setResponseBank] = useState(new Array(112).fill(null));
  const [currentQuestion, setCurrentQuestion] = useState(0);

  useEffect(() => {
    fetch("/api/questions")
      .then((res) => res.json())
      .then((data) => {
        setQuestionBank({questions: data});
      })
      .catch(console.log);
  }, []);

//   console.log(questionBank)

  return null
}

export default Survey;
